import React from 'react';

const Page1 = ({ onNext }) => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-green-900 text-white relative">
      <div className="absolute top-4 right-4 text-2xl">
        <button className="text-white" onClick={onNext}>
          &#x23FB; {/* Unicode character for the power symbol */}
        </button>
      </div>
      <h1 className="text-4xl mb-4">Hello [user],</h1>
      <p className="text-2xl mb-6">What do you feel today?</p>
      <input 
        type="text" 
        className="p-2 w-96 rounded-full bg-amber-200 text-black placeholder-gray-700 text-xl" 
        onClick={onNext} 
        placeholder="T" 
      />
    </div>
  );
};

export default Page1;
